 * @alternative <AwWidget>
 * @obsoleteIn afx@6.0.0
 * @returns {JSX.Element} react component
 */
export const awPropertyBooleanRenderFunction = ( props ) => {
    const {
        viewModel,
        ctxMin,
        actions,
        i18n,
        fields,
        grids,
        formProp,
        messages,
        ...prop
    } = props;
    const { hint } = prop;
